import './About.css';
import theme from '../Imagelogo/theme_pattern.svg';
import aboutimg from '../Imagelogo'

function About() {
  return (
    <div className='about'>
        <div className="about-title">
            <h1>About Me</h1>
            <img src={theme} alt=''/>
        </div>
        <div className="about-section">
            <div className="about-left">
                <img src='' alt=''/>
            </div>
        </div>
    </div>
  )
}

export default About
